PREFIX brick: <https://brickschema.org/schema/Brick#>
PREFIX s223: <https://s223online.org/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?zone ?zoneLabel ?propLabel ?alcLabel ?mpcLabel WHERE {
  # zones (targets)
  ?zone a brick:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel }

  # nonwritable properties related to the zone
  OPTIONAL {
    ?prop a s223:NonWritableProperty .
    # any predicate that links a zone to the property  adjust if model uses a specific predicate
    ?zone ?rel ?prop .
    ?prop rdfs:label ?propLabel .
  }

  # ALC endpoint reference
  OPTIONAL {
    ?alc a s223:ALC_Endpoint .
    ?zone s223:hasALCEndpoint ?alc .
    ?alc rdfs:label ?alcLabel .
  }

  # MPC endpoint reference
  OPTIONAL {
    ?mpc a s223:MPC_Endpoint .
    ?zone s223:hasMPCEndpoint ?mpc .
    ?mpc rdfs:label ?mpcLabel .
  }
}
ORDER BY ?zone

